comment:
중고딩때 생각해보면 저런 초록머리 같은 애들 넘 많음 ;; 
다같이 많은 사람들 앞에 나가서 하는거하면 쪽팔리고 놀림 받을 꺼 같고 한건 이해 하겠는데ㅋㅋㅋ
혼자만 빠지면 뭐 디게 분위기 있어보이는 줄 아는듯ㅋㅋㅋㅋㅋㅋㅋ꼭 그런애들이 솔직하고 당당하게 자기 기분 말은 못하고 뒤에서 씹고ㅋㅋㅋㅋㅋ

아니 도대체 미용실 어디갔길래
머리가 브로콜리인거야;
거기다 고구마 인성;;
다이어트식인가

쑥떡이 또 뭔행패부렸네;;
발암캐릭 이쯤되면 그만나올법하지않음?
핑크머리 좀 착해지니까 왠 애벌래가 기어와;

아니 이번화에서 덕구가 어떻게 답답하다는거야

덕구가 고의로 잘못한거냐;;

덕구가 응 나 꽃님이 같은 애랑 안놀아 하고 안간것도 아니고

시간 공지 잘못해줘서 저렇게 겨우 갔는데

이걸 답답하다고 못박아버리네

웹툰 다시볼거면 너나 제대로좀 쳐보셈;

근데 베댓들이 다 꽃님이 탓하네;;
꽃님이는 이제 더이상 상처받기 싫은거임 너무 아파했잖 고민했고 이제 꾳님이도 포기할만 하자나 
ㄹㅇ 울 꽃님이한테 뭐라그르지마셈

서운하니깐 서운한티를 내는거지;;
솔까 중요하게 생각했으면 늦었겠냐? 꽃님이는 덕구랑 사귀고싶었는데 못한거아녀.......밀당? 밀당이라치자!!
밀당에도 정도가있지

솔직히 꽃님이 상황도 이해해줘야하는거 아님?
꽃님이가 진짜 기대많이 하고 노력도 많이 했던 거잖아;
다 꽃님이 한테만 그러냐;;

내일 자기한테 사탕줄사람 없는 애 눌러라,,
그럼 받을거야





















































아빠한테;;

임꽃님한테 걍 덕구랑 사귀라고하는 댓글이 많아서 씁니다.
꽃님이 벌써 고백했고 마음표시도 계속하는데
덕구가 계속 끌잖아요..;;

ㅠ제발 시아야 눈치 좀;
보는 내가 짜증나네
탐나라이 사이다 날렸으면..

요즘그림체 왜이래욥...?
옛날에는 되게 이쁘게 잘 그렸는데 요즘따라 캐릭터가 못생겨졌네요;;
악댓은 아니에요...ㅎㅎㅎ
